import React, {Component} from 'react';
import Grid from "@material-ui/core/Grid";
import withStyles from "@material-ui/core/styles/withStyles";
import style from "./style";
import Paper from "@material-ui/core/Paper";
import ButtonGroup from "@material-ui/core/ButtonGroup";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import Slider from "@material-ui/core/Slider";

class Home extends Component {
    constructor() {
        super();
        this.state={
            value: [20, 37]
        }
    }

    handleChange = (event, newValue) => {
        console.log(newValue);
        // event.preventDefault();
        this.setState({
            value: newValue
        });
    };

    valuetext = () => {
        return `${this.state.value}°C`;
    };

    setVeg=()=>{

    };

    setNonVeg=()=>{

    };

    render() {
        const { classes } = this.props;

        return (
            <div className={classes.root}>
                <Grid container>
                    <Grid item xs={12}>
                        <div className={classes.spacer}>
                        </div>
                    </Grid>
                    <Grid item
                          xl={4}
                          lg={4}
                          md={4}
                          xs={12}
                          style={{textAlign:"center"}}
                    >
                        <div className={classes.paddingClass}>
                            <Paper className={classes.paddingClass}>
                                <div className={classes.internalPadding}>
                                    <ButtonGroup size="small" aria-label="small outlined button group">
                                        <Button onClick={this.setVeg}>Veg</Button>
                                        <Button onClick={this.setNonVeg}>Non-Veg</Button>
                                    </ButtonGroup>
                                </div>
                                <div className={classes.internalPadding}>
                                    <Typography id="range-slider" gutterBottom>
                                        Temperature range
                                    </Typography>
                                    <Slider
                                        value={this.state.value}
                                        step={100}
                                        min={100}
                                        max={600}
                                        onChange={this.handleChange}
                                        valueLabelDisplay="auto"
                                        aria-labelledby="range-slider"
                                        getAriaValueText={this.valuetext}
                                        style={{width: '70%'}}
                                    />
                                </div>
                            </Paper>
                        </div>
                    </Grid>
                    <Grid item
                          xl={8}
                          lg={8}
                          md={8}
                          xs={12}
                    >
                        <div>
                            1234567
                        </div>
                    </Grid>
                </Grid>
            </div>
        );
    }
}

export default withStyles(style)(Home);
